package com.ywhk.ckb.dao.model.core;import lombok.Data;import org.hibernate.annotations.GenericGenerator;import javax.persistence.*;import java.util.Date;/** * 鉴别诊断 */@Data@Entity@Table(name="KLN_BAS_Differential")public class DifferentialEntity {    @Id    @GeneratedValue(strategy = GenerationType.IDENTITY)    @Column(name = "FDifferentialID", nullable = false)    private Integer FDifferentialID;    @Column(name = "FDiseaseID", nullable = false)    private Integer FDiseaseID;    @Column(name = "FType", nullable = false, length = 50)    private String FType;    @Column(name = "FOrderNumber", nullable = false)    private Integer FOrderNumber;    @Column(name = "FNumber", nullable = false, length = 50)    private String FNumber;    @Column(name = "FName", nullable = false, length = 512)    private String FName;    @Column(name = "FDiacrisis", nullable = false, length = 16)    private String FDiacrisis;    @Column(name = "Fpy", nullable = false, length = 256)    private String Fpy;    @Column(name = "Fwb", nullable = false, length = 50)    private String Fwb;    @Column(name = "Fexp", nullable = false, length = 200)    private String Fexp;    @Column(name = "Fmark", nullable = false)    private Integer Fmark;    @Column(name = "FCreateDate", nullable = false, length = 8)    private Date FCreateDate;    @Column(name = "FCreateuserID", nullable = false)    private Integer FCreateuserID;    @Column(name = "FModifyDate", nullable = false, length = 8)    private Date FModifyDate;    @Column(name = "FModifyUserID", nullable = false)    private Integer FModifyUserID;}